import React, { Component } from "react"

export default class Dog extends Component {
    constructor() {
        super()
        this.state = {
            allPups: []
        }
    }

    displayPupNames = () => {
        fetch("http://localhost:3000/pups")
            .then(resp => resp.json())
            .then(pups => {
                this.setState({ allPups: pups })
                console.log(this.stateallPups)
            })

    }


    render() {
        return this.state.allPups
    }
}
